insert  into `faqitems`(`id`,`sectionID`,`question`,`answer`,`ordering`,`hint`) values 
(8,1,'What happens if I am travelling alone? Is there an extra charge?','There are two options if you are a solo traveller with DiscoverTurkey. If you prefer to have your own room then you can book and pay for the added single supplement (see below). Alternatively you can book for a twin room and we will match you up with someone of the same gender whilst on tour, thereby saving you the cost of that single supplement.\r\n\r\n',4,0),
(9,1,' What is the single supplement?','The single supplement is the added price you pay to guarantee a single-room during the course of your tour.\r\n\r\n',4,0),
(10,1,'Are prices based on double occupancy?','Yes, all our tour prices are quoted on a two people sharing a twin-room.',5,0),
(11,1,'Are airport transfers included?','Yes. Pre and Post tour airport transfers are included',5,0),
(12,1,'Does the price include any flights?','Only when stipulated in the itinerary are domestic flights within Turkey included',4,0),
(3,1,'How do I make a reservation?','Please see Tour Enquiries and Booking under CONTACT US menu in this website for details to book your tour.\r\n\r\n',2,0),
(7,1,'Are there any discounts or money saving offers to take advantage of?','DiscoverTurkey welcomes groups of any size. If a group of six or more people travel together then a discount of 2.5% per person applies to the land-only portion of your tour. So if you have a group of friends then it pays to get yourselves together and book as one group! There is also a 5% Earlybird discount on the tour price for those who book and pay for their 2017 tour by 31 December 2017.\r\n\r\n',3,0),
(4,2,'How much luggage can I take?','There is NO luggage weight limit on our coaches and you may also bring one piece of carry-on onto the coach.\r\nLeave some space in your luggage though – you’ll no doubt want to bring home some souvenirs from the cities and places you visit!\r\nEach airline has specific rules as to luggage allowances – check directly with them or ask your travel consultant to confirm for you.\r\n\r\n',2,0),
(13,2,'How long are the travelling days?','At DiscoverTurkey we understand that you don’t want to see Turkey only through the windows of a coach nor be rushed through the sites visited. For that reason our aim has been to reduce the length of typical travel days.\r\nThe tours are basically designed to reduce the length of driving days in comparison with most other tour companies. On the occasional long day where we travel relatively long distances, our trips are organised to make travelling as convenient and efficient as possible with interesting stops and or scenery. The journey between different parts of a country or region is sometimes a highlight of a trip, with interesting and spectacular landscapes encountered en route.\r\n\r\n',1,0),
(14,2,'Where will my hotel be and what will it be like?','We are using 5 star quality and above. Of those we have picked hotels in each location that we believe offer the best combination of quality and location. DiscoverTurkey hotels are consistently of first class standard and higher or in a style appropriate to the destination. They have been selected because they are great private or small collection hotels or from well-known chains such as Hilton or Rixos.',3,0),
(15,2,'What is the difference between “visit”, “view” and “see” in the itineraries?','“Brochure-speak” can quite often confuse and even mis-lead a lot of guests! Here is a glossary of some common terms used in our itineraries:\r\nVisit – Your coach will stop and you’ll get to visit a specific site.\r\nView – A brief stop and an opportunity to take photos.\r\nSee – Your coach will drive by the site so that you can see it.\r\nSightseeing tour – Our Guide will accompany you on a tour of a city or site.\r\nOrientation tour – Typically provided by your guide, the places of interest are pointed out, allowing you to go and explore them on your own.\r\nTime to explore and discover – Free time on your own.\r\nA day to relax – No planned activities; time for optional excursions or other independent activities.\r\n\r\n',3,0);
